import React from "react";
import Pokemon from "../Img/Pokemon.png";
import "./Projects.css";
const Projects = () => {
  return (
    <div className="container">
      <div className="row bg-success  ">
        <div className="col-12 fs-1 text Projects">My Projects</div>
        <div className="row mx-4 mb-4 mt-4 container-card align-items-start p-3 ">
          <div className="col-2">
            <img src={Pokemon} alt="noPokemon" />
          </div>
          <div className="row">
            <div className="col">
              <p className="Rest-Api-Text">Rest Api</p>
              <p className="Rest-Api-Res">
                Pokemon project with various Technologies
              </p>
            </div>
          </div>
          <div className="row">
            <button type="button" class="btn btn-outline-warning">
              Warning
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Projects;
